import Layout from '../components/Layout'

const Index = () => (
    <Layout>
        <div>
            <h1>Welcome to BitzPrice</h1>
        </div>
        <canvas id="canvas" class="canvasrainbox"></canvas>
    </Layout>
);

export default Index
